import { Link } from "react-router-dom";
import "./styles/Movies.css";
const Movies = ({ props }) => {
  if (!props) {
    return <h1>No hay resultados para tu busqueda</h1>;
  }
  return (
    <div className="card">
      <div className="col-">

      <Link to={`/movies/${props.imdbID}`}></Link>

      </div>

    </div>
  );
};

export default Movies;
